import './App.css';
import WalletDashboard from './App/pages/WalletDashboard';
import Login from './App/pages/Login';
function App() {
  return (
	<>
	  this.state.isLoggedIn?<Login />:<WalletDashboard />
    </>
  );
}

export default App;
